import React from 'react';
import './Content.css';
import vid from './Image/vid3.mp4';
import vid1 from './Image/vid4.mp4';
import video from './Image/vid5.mp4';

const Video = ({ src }) => (
  <video autoPlay muted loop>
    <source src={src} type="video/mp4" />
    Your browser does not support the video tag.
  </video>
);

const Content = () => {
  return (
    <div className="container">
      <div className="grid-container">
        <div className="main-content">
          <h2>Main Content</h2>
        </div>
        <div className="sidebar">
          <h2>Information</h2>
          <Video src={vid} />
          <p>This is a sidebar with additional information.</p>
        </div>
        <div className="sidebar2">
          <h2>Information</h2>
          <Video src={vid1} />
          <p>This is another sidebar with additional information.</p>
        </div>
        <div className="service-content">
          <h2>Our Service</h2>
          <p><strong>We provide the best service as you want.</strong></p>
          <Video src={video} />
        </div>
      </div>
    </div>
  );
};

export default Content;
